public String toString() {
  String strType;
  if (type < NAMES.length && type > 0) {
    strType = NAMES[type];
  } else {
    strType = String.valueOf(type);
  }
  return "DataChecksum(type=" + strType +
    ", chunkSize=" + bytesPerChecksum + ")";
}
